/*Random Data Generator */
function sinAndCos() {
    var sin = [],sin2 = [], cos = [];
    var data = [];

    //Data is represented as an array of {x,y} pairs.
    for (var i = 0; i < 100; i++) {
        data.push({
            time: i,
            sin: Math.sin(i/10),
            sin2: Math.sin(i/10) *0.25 + 0.5,
            cos: 0.5 * Math.cos(i/10+ 2) + Math.random() / 2
        });
    }
    return data;
}

var dataObject = sinAndCos();

return msg.res.status(200).send(dataObject);
